% connectivity
route([From, To, Visited, Length, Max], [From, To]) :-
    Length =< Max,
    airroutes_hasOutboundRouteTo(From, To),
    \+member(To, Visited).
route([From, To, Visited, Length, Max], [From|NewRoute]) :-
    Length =< Max,
    airroutes_hasOutboundRouteTo(From, Via),
    \+member(Via, Visited),
    NewLength is Length+1,
    route([Via, To, [From|Visited], NewLength, Max], NewRoute).

